import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import { getAllUsers } from "../../api/peopleApi";

function PeopleList() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getAllUsers().then(setUsers);
  }, []);

  return (
    <div>
      <h2>People Management</h2>

      {/* ACTION BAR */}
      <div style={{ marginBottom: 20 }}>
        <Link to="/people/add">
          <button style={{ marginRight: 10 }}>‚ûï Add User</button>
        </Link>

        <Link to="/people/promote">
          <button style={{ marginRight: 10 }}>‚¨ÜÔ∏è Promote User</button>
        </Link>

        <Link to="/schedule">
          <button style={{ marginRight: 10 }}>üìÖ Schedule</button>
        </Link>

        <Link to="/people/availability">
          <button>üïí Availability / Time Off</button>
        </Link>
      </div>

      {/* USER TABLE */}
      <table border="1" width="100%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Full Name</th>
            <th>Salary / Hour</th>
          </tr>
        </thead>
        <tbody>
          {users.map(u => (
            <tr key={u.id}>
              <td>{u.id}</td>
              <td>{u.fullName}</td>
              <td>{u.salaryPerHour}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default PeopleList;
